import React from "react"
import styled from "styled-components"
import FILE1 from "../components/files/file1"

const Ul = styled.ul`
  display: flex;
  align-items: center;
  justify-content: center;
`
const Li = styled.li`
  list-style: none;
  width: 40px;
  height: 40px;
  text-align: center;
  line-height: 40px;
  border-radius: 50%;
  background-color: red;
  margin: 0 10px;
  cursor: pointer;
  &:hover {
    background-color: aqua;
    color: red;
    font-size: 18px;
  }
`
const API = [
  {
    page: 1,
  },
  {
    page: 2,
  },
  {
    page: 3,
  },
  {
    page: 4,
  },
  {
    page: 5,
  },
  {
    page: 6,
  },
  {
    page: 7,
  },
  {
    page: 8,
  },
  {
    page: 9,
  },
  {
    page: 10,
  },
]
const Home = () => {
  return (
    <div>
      <div>
        <Ul>
          <Li>1</Li>
          <Li>2</Li>
          <Li>3</Li>
          <Li>4</Li>
          <Li>5</Li>
          <Li>6</Li>
          <Li>7</Li>
          <Li>8</Li>
          <Li>9</Li>
          <Li>10</Li>
        </Ul>
      </div>
      <table border={1}>
        <tr>
          <th>ID voice</th>
          <td>duration</td>
        </tr>
        {FILE1.map((item) => (
          <tr key={item.voice_id}>
            <th>{item.voice_id}</th>
            <td>{item.audioCredit.callDuration}</td>
          </tr>
        ))}
      </table>
    </div>
  )
}

export default Home
